"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Transsexualism (The Basics)",
"    </div>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H91639106\">",
"      <span class=\"h1\">",
"       What is transsexualism?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Transsexualism is a condition that causes a person to feel that they were born as the wrong sex. A male transsexual has a strong desire to look like and to live life as a female. A female transsexual has a strong desire to look like and to live life as a male. Transsexuals might take medicines or have surgery to change their bodies so they can look and feel more like the opposite sex.",
"     </p>",
"     <p>",
"      Transsexualism is not the same as homosexuality, which means a person is sexually attracted to people of the same sex. A transsexual person is also different than a &ldquo;transgender&rdquo; person. Transgender people want to live as the opposite sex at least part of the time, but do not want surgery to change their bodies. Transsexuals also differ from &ldquo;transvestites&rdquo; (also called &ldquo;cross-dressers&rdquo;), who sometimes dress like a member of the opposite sex.",
"     </p>",
"     <p>",
"      Transsexualism is also called &ldquo;gender identify disorder.&rdquo;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H91639121\">",
"      <span class=\"h1\">",
"       What are the symptoms of transsexualism?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The main symptom of transsexualism is feeling that you were born the wrong sex. Many adult transsexuals say they had these feelings as children, before they went through &ldquo;puberty.&rdquo; Puberty is the term for the changes the body goes through during the pre-teen and teen years.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H91639136\">",
"      <span class=\"h1\">",
"       When and how is transsexualism treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Experts say that children with gender identity issues should not be treated until they are at least 16 years old. For some children, doctors prescribe medicines that stop puberty. This prevents sexual changes in children&rsquo;s bodies and gives them more time to figure out if they are transsexual. Most children and young teens who have gender identity issues do NOT become transsexuals. If they are transsexual, they can start medical treatment around age 16, but should wait to have surgery until they turn 18.",
"     </p>",
"     <p>",
"      Treatments include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Therapy with a counselor (such as a psychiatrist, psychologist, nurse, or social worker) - Talking with a counselor about your condition can help you better understand what to expect from the surgery and medicines. He or she might also put you in touch with other transsexuals who have already changed to their new sex. This can help you get a better idea of what you might experience as your body changes, and what problems or challenges you might face.",
"        <br/>",
"        <br/>",
"        Part of the therapy includes a &ldquo;real life test,&rdquo; which should be done either before or soon after you start medical treatment. A real life test means that you live as a person of the opposite sex for at least 1 year. Experts advise that you do this to experience what your life will be like in your new role, before you have surgery.",
"       </li>",
"       <li>",
"        Medicines &ndash; These include sex hormones and medicines that block sex hormones. Hormones are chemical messengers that turn on and off different process in the body. Sex hormones cause changes in the sexual organs and other parts of the body. These medicines are taken as pills, injections (shots), or a gel that you rub on your skin.",
"        <br/>",
"        <br/>",
"        Male-to-female transsexuals take medicines that block male hormones (called &ldquo;androgens&rdquo;). Androgens cause hair to grow on the body and face, so medicines that block androgens help lessen body hair. They then take female hormones (&ldquo;estrogens&rdquo;) that make their breasts grow.",
"        <br/>",
"        <br/>",
"        Female-to-male transsexuals take androgens. This usually stops their monthly periods. Androgens also cause women to grow hair on their faces. It also makes the &ldquo;clitoris&rdquo; grow (",
"        <a class=\"graphic graphic_figure graphicRef53704 \" href=\"UTD.htm?0/10/160\">",
"         figure 1",
"        </a>",
"        ). The clitoris is the bundles of nerves above the vagina that gives women sexual pleasure.",
"       </li>",
"       <li>",
"        Surgery &ndash; The surgery for male-to-female transsexuals includes a creating a pouch that serves as a vagina. The surgeon uses the skin of the penis to line the inside of the new vagina. He or she uses the skin of the scrotum (",
"        <a class=\"graphic graphic_figure graphicRef68075 \" href=\"UTD.htm?21/43/22194\">",
"         figure 2",
"        </a>",
"        ) to create the folds of tissue around the vagina (called &ldquo;labia.&rdquo;) Some people also have surgery to make their breasts larger.",
"        <br/>",
"        <br/>",
"        The surgery for female-to-male transsexuals includes removing the breasts, uterus, and ovaries. Some people also have surgery to create a penis. The surgeon uses tissue from the person&rsquo;s arm or leg to create a penis. He or she can also lengthen the tube that carries urine from the bladder to outside the body (called the &ldquo;urethra&rdquo;). That way, the person can urinate standing up. The labia can be used to create a scrotum. Small plastic balls can be put inside the scrotum to make testicles.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H91639151\">",
"      <span class=\"h1\">",
"       Can treatments for transsexualism cause any medical problems?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The hormones that transsexuals take might make them slightly more likely to have certain medical conditions, including dangerous blood clots, heart disease, breast cancer, and prostate cancer. Experts say that transsexuals who take hormones should see their doctors every 3 months for the first year of treatment, then 1 or 2 times a year after that. The doctor should test the person&rsquo;s hormone level and check for any medical problems.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H91639168\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?30/1/30738?source=see_link\">",
"       Patient information: Normal sexual development (puberty) (The Basics)",
"      </a>",
"     </p>",
