"     </b>",
"     Topical: Cream, lotion: Apply to affected areas 1-2 times daily for 1 month",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Tinea versicolor:",
"     </b>",
"     Topical: Cream: Apply to affected areas once daily for 2 weeks",
"    </p>",
"   </div>",
