"   </div>",
"   <div class=\"block dot drugH1Div\" id=\"F184494\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Adjustment for Toxicity",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     It is recommended that new courses begin only after the granulocyte count recovers to &ge;1500/mm",
"     <sup>",
"      3",
"     </sup>",
"     , the platelet counts recover to &ge;100,000/mm",
"     <sup>",
"      3",
"     </sup>",
"     , and treatment-related diarrhea has fully resolved. Depending on the patient's ability to tolerate therapy, doses should be adjusted in increments of 25-50 mg/m",
"     <sup>",
"      2",
"     </sup>",
"     . Treatment should be delayed 1-2 weeks to allow for recovery from treatment-related toxicities. If the patient has not recovered after a 2-week delay, consider discontinuing irinotecan. See tables.",
"    </p>",
