var title_f7_41_7836="Toilet training guidance";
var content_f7_41_7836=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F72501&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F72501&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Anticipatory guidance for toilet training",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Visit",
"       </td>",
"       <td class=\"subtitle1\">",
"        Action",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        12-month",
"       </td>",
"       <td>",
"        Discourage active toilet training until after 18-month visit",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Evaluate parental expectations",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        15-month",
"       </td>",
"       <td>",
"        Discuss the criteria for readiness",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        18-month",
"       </td>",
"       <td>",
"        Review the criteria for readiness",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Provide written information on the toilet-training process",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"4\">",
"        24-month",
"       </td>",
"       <td>",
"        Evaluate the child's readiness",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Provide feedback on progress and plan if training has begun",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Discuss nighttime enuresis if the child has daytime control",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Congratulate the child and parents if the child is toileting independently",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"5\">",
"        36-month",
"       </td>",
"       <td>",
"        Provide feedback on progress and plan",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Discuss toileting refusal issues",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Discuss nighttime enuresis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Discuss reasons for follow-up before 48-month visit",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Congratulate the child and parents if the child is toileting independently",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"3\">",
"        48-month",
"       </td>",
"       <td>",
"        Discuss nighttime enuresis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Revisit any medical causes that may be interfering with completion of toilet training (eg, constipation)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Refer to behavior specialist if child refuses daytime training",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from Michel RS. Pediatrics in Review 1999; 20:240.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
