" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Epigastric hernia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 316px; height: 334px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    An epigastric hernia occurs when bowel protrudes through a weakness in the linea alba. The small bulge appears midline between the xiphoid process and the umbilicus. It may be discovered only on palpation.",
"    <div class=\"footnotes\">",
